import React, { Component } from 'react';

class DiyList extends Component{
    constructor(props) {
        super(props);
        this.state = {
            category: ''
        }
    }
    
    render(){
        return(
            <div>
                <h2>List</h2>
            </div>
        );
    }
}

export default DiyList;
